import { Marker, Popup } from 'react-leaflet';

function MarkerPoint(props) {

  const lat = props.lat
  const lng = props.lng

  return (
    <Marker position={[{lat}, {lng}]}>
        <Popup>
        A pretty CSS3 popup. <br /> Easily customizable.
        </Popup>
    </Marker>
  );
}

export default Map;
